import React from 'react';
import {Box, Heading, HStack, Tab, TabList, TabPanel, TabPanels, Tabs} from "@chakra-ui/react";

const ReportDetailPage = () => {
    return (
        <Box w={'100%'}>
            <Tabs p={5} minH={'100vh'} size={'lg'} variant={"enclosed"} colorScheme={'blue'}>
                <TabList bg={'gray.200'}>
                    <Tab>Participants</Tab>
                    <Tab>Two</Tab>
                    <Tab>Three</Tab>
                </TabList>

                <TabPanels bg={'white'} mt={5} w={'100%'}>
                    <TabPanel>
                        <HStack>
                            
                        </HStack>

                    </TabPanel>
                    <TabPanel>
                        <p>two!</p>
                    </TabPanel>
                    <TabPanel>
                        <p>three!</p>
                    </TabPanel>
                </TabPanels>
            </Tabs>
        </Box>
    );
};

export default ReportDetailPage;
